import React, { Component } from 'react';

export const MenuItems = [
    {
        href : '#',
        class : 'home',
        value : 'Home'
    },
    {
        href : '#',
        class : 'services',
        value : 'Services'
    },
    {
        href : '#',
        class : 'product',
        value : 'Product'
    },
    {
        href : '#',
        class : 'contact',
        value : 'Contact Us'
    },
]
